import * as REST from "./constants";
import axios from "axios";

export const Vendor_Api = {
  Add_Vendor: function(fields) {
    return axios({
      method: "post",
      url: `${REST.BASE_URL}${REST.VENDOR.ADD_VENDOR}`,
      data: fields,
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        api: "d8c0e382b93dbcc599758bd63da536b18c10c3a06a610a1b7f7d2ece1dd49b2c",
        secret:
          "271ba52ba0f545733f5392f1c5afa8d8bacac15da40d78ea1dec5667ae8ebd20"
      }
    })
      .then(function(response) {
        console.log(response);
        return response.data;
      })
      .catch(function(error) {
        return error.response.data;
      });
  },

  Get_Vendor: function() {
    return axios({
      method: "get",
      url: `${REST.BASE_URL}${REST.VENDOR.GET_VENDOR}`,
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        api: "d8c0e382b93dbcc599758bd63da536b18c10c3a06a610a1b7f7d2ece1dd49b2c",
        secret:
          "271ba52ba0f545733f5392f1c5afa8d8bacac15da40d78ea1dec5667ae8ebd20"
      }
    })
      .then(function(response) {
        return response.data;
      })
      .catch(function(error) {
        return error.response.data;
      });
  }
};
